import React from "react";

const Services = () => {
  const services = [
    {
      icon: (
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M10 20l4-16m4 4l4 4-4 4M6 16l-4-4 4-4"
          />
        </svg>
      ),
      title: "Web Development",
      description:
        "Custom websites and web applications built with modern technologies like React, Node.js, and more.",
      features: [
        "Responsive Design",
        "SEO Optimized",
        "Fast Loading",
        "Cross-browser Compatible",
      ],
    },
    {
      icon: (
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M12 18h.01M8 21h8a2 2 0 002-2V5a2 2 0 00-2-2H8a2 2 0 00-2 2v14a2 2 0 002 2z"
          />
        </svg>
      ),
      title: "Mobile Development",
      description:
        "Native and cross-platform mobile applications for iOS and Android using React Native.",
      features: [
        "Cross-platform",
        "Native Performance",
        "App Store Ready",
        "Push Notifications",
      ],
    },
    {
      icon: (
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M7 21a4 4 0 01-4-4V5a2 2 0 012-2h4a2 2 0 012 2v12a4 4 0 01-4 4zM21 5a2 2 0 00-2-2h-4a2 2 0 00-2 2v12a4 4 0 004 4h4a2 2 0 002-2V5z"
          />
        </svg>
      ),
      title: "UI/UX Design",
      description:
        "Beautiful and intuitive user interfaces designed with user experience in mind.",
      features: [
        "User Research",
        "Wireframing",
        "Prototyping",
        "Design Systems",
      ],
    },
    {
      icon: (
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M9 12l2 2 4-4m5.618-4.016A11.955 11.955 0 0112 2.944a11.955 11.955 0 01-8.618 3.04A12.02 12.02 0 003 9c0 5.591 3.824 10.29 9 11.622 5.176-1.332 9-6.03 9-11.622 0-1.042-.133-2.052-.382-3.016z"
          />
        </svg>
      ),
      title: "Consulting",
      description:
        "Technical consulting and guidance to help you make the right technology decisions.",
      features: [
        "Technology Audit",
        "Architecture Planning",
        "Code Review",
        "Team Training",
      ],
    },
    {
      icon: (
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M13 10V3L4 14h7v7l9-11h-7z"
          />
        </svg>
      ),
      title: "Performance Optimization",
      description:
        "Improve your website speed and performance for better user experience and SEO.",
      features: [
        "Speed Analysis",
        "Code Optimization",
        "Image Optimization",
        "Caching Strategies",
      ],
    },
    {
      icon: (
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"
          />
        </svg>
      ),
      title: "Data Analytics",
      description:
        "Data-driven insights and analytics to help you understand your users and improve your product.",
      features: [
        "Analytics Setup",
        "Data Visualization",
        "User Behavior Analysis",
        "Performance Metrics",
      ],
    },
  ];

  return (
    <section id="services" className="py-20 bg-gray-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="text-center mb-16">
          <h2 className="text-4xl font-bold text-gray-900 mb-4">
            {" "}
            My Services{" "}
          </h2>{" "}
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Comprehensive solutions to bring your digital vision to life{" "}
          </p>{" "}
        </div>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {" "}
          {services.map((service, index) => (
            <div
              key={index}
              className="bg-white rounded-xl p-8 shadow-lg hover:shadow-xl transition-shadow duration-300 group"
            >
              <div className="text-primary-600 mb-6 group-hover:scale-110 transition-transform duration-300">
                {" "}
                {service.icon}{" "}
              </div>
              <h3 className="text-xl font-semibold text-gray-900 mb-4">
                {" "}
                {service.title}{" "}
              </h3>
              <p className="text-gray-600 mb-6 leading-relaxed">
                {" "}
                {service.description}{" "}
              </p>
              <ul className="space-y-2">
                {" "}
                {service.features.map((feature, featureIndex) => (
                  <li
                    key={featureIndex}
                    className="flex items-center text-sm text-gray-600"
                  >
                    <svg
                      className="w-4 h-4 text-green-500 mr-2 flex-shrink-0"
                      fill="currentColor"
                      viewBox="0 0 20 20"
                    >
                      <path
                        fillRule="evenodd"
                        d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z"
                        clipRule="evenodd"
                      />
                    </svg>{" "}
                    {feature}{" "}
                  </li>
                ))}{" "}
              </ul>{" "}
            </div>
          ))}{" "}
        </div>
        {/* CTA Section */}{" "}
        <div className="mt-16 text-center">
          <div className="bg-primary-600 rounded-2xl p-12 text-white">
            <h3 className="text-3xl font-bold mb-4">
              {" "}
              Ready to Start Your Project ?{" "}
            </h3>{" "}
            <p className="text-xl mb-8 opacity-90">
              Let 's discuss how I can help bring your ideas to life{" "}
            </p>{" "}
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <button className="bg-white text-primary-600 hover:bg-gray-100 font-medium py-3 px-8 rounded-lg transition-colors duration-200">
                Get Free Quote{" "}
              </button>{" "}
              <button className="border-2 border-white text-white hover:bg-white hover:text-primary-600 font-medium py-3 px-8 rounded-lg transition-colors duration-200">
                View Portfolio{" "}
              </button>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </div>{" "}
    </section>
  );
};

export default Services;
